import React from "react";
import Navbar from "./Navbar";
import "./AdminPanel.css";

class AdminPanel extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  componentDidMount() {}

  render() {
    return (
      <div>
        <Navbar />
        Admin panel
      </div>
    );
  }
}

export default AdminPanel;
